import Header from "../components/Header";
import { experience } from "../constants";

const Experience = () => {
  return (
    <main>
      <Header />
      <div className="text-slate-100 font-thin text-2xl">
      <div className="absolute right-10 top-10 flex flex-col justify-center h-screen">
          <ul className="text-right uppercase hover:cursor-pointer">
            {experience.map((job) => (
              <li key={job.id} className="mb-10">
                <h2>{job.title}</h2>
              </li>
            ))}
          </ul>
      </div>
      </div>
    </main>
  );
};

export default Experience;
